import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../../components/Navbar";
import "./registration.css"; // Ensure the CSS file exists

function Registration() {
  const navigate = useNavigate();

  // ✅ State for input fields
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [storeName, setStoreName] = useState("");
  const [ownerName, setOwnerName] = useState("");
  const [storeAddress, setStoreAddress] = useState("");

  // ✅ Handle form submission
  const handleSubmit = async (event) => {
    event.preventDefault();

    if (!username || !email || !password || !storeName || !ownerName || !storeAddress) {
      alert("Please fill in all fields.");
      return;
    }

    const formData = {
      username,
      email,
      password,
      store_name: storeName,
      owner_name: ownerName,
      store_address: storeAddress,
    };

    try {
      const response = await fetch("/api/register-retail/", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.error || "Registration failed.");
      }

      alert("Registration successful! Awaiting admin approval.");
      navigate("/login");
    } catch (error) {
      console.error("Registration failed:", error);
      alert(error.message);
    }
  };

  return (
    <>
      <Navb />
      <div className="registration-container">
        <div className="registration-box">
          <div className="registration-form">
            <h2>Retail Seller Registration</h2>
            <form onSubmit={handleSubmit}>
              <div className="input-items">
                <label>Username:</label>
                <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} required />
              </div>
              <div className="input-items">
                <label>Email:</label>
                <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
              </div>
              <div className="input-items">
                <label>Store Name:</label>
                <input type="text" value={storeName} onChange={(e) => setStoreName(e.target.value)} required />
              </div>
              <div className="input-items">
                <label>Owner Name:</label>
                <input type="text" value={ownerName} onChange={(e) => setOwnerName(e.target.value)} required />
              </div>
              <div className="input-items">
                <label>Store Address:</label>
                <input type="text" value={storeAddress} onChange={(e) => setStoreAddress(e.target.value)} required />
              </div>             
              <div className="input-items">
                <label>Password:</label>
                <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} required />
              </div>
              <button type="submit" className="submit-btn">Register</button>
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default Registration;
